import React from "react";

export default Header = () => {
  return (
    <nav>
      <ul>
        <li>
          <a>Work</a>
        </li>
        <li>
          <a>Experiments</a>
        </li>
        <li>
          <a>About</a>
        </li>
        <li>
          <a>Resume</a>
        </li>
      </ul>
    </nav>
  );
};
